style:
*{
	margin: 0;
	padding: 0;
	box-sizing: border-box;
}
body{
	background: #000;
}


ul{
	position: absolute;
	top: 0;
	bottom: 0;
	width: 100%;
	height: auto;
	line-height: 100%;
	padding:50% 0;
	overflow-x: hidden;
	overflow-y: auto;
	list-style: none;
  transition: 0.3s all ease;
}
li{
	width:auto;
	word-break: keep-all;
    white-space: nowrap;
    text-overflow: ellipsis;
  margin:10% 0;
	list-style: none;
	text-align: center;
	font-size: 1em;
  color: #aaa;
  font-weight: normal;
  transition: 0.3s all ease;
}
li.active{ 
    color: #fff;
    font-size: 1.125em;
    font-weight: bold;
}

li.active>font{
		color: rgb(54, 127, 196);
}


#toast{
    	position: absolute;
    top: -80px;
    left: 15px;
    line-height: 50px;
    font-size:20px;
    font-weight: bold;
    color:#555;
    padding:0px 20px 0px 20px;
    background: rgb(220, 220, 220,.8);
    	border-radius: 5px;
    transition:top 0.3s cubic-bezier(.38,-0.38,.62,1.54); 
}
#toast.active{
    top: 15px;
}



#player{
	position: absolute;
	bottom:0;
	width:100%;
	height:auto;
}

/* æ­Œæ›²ä¿¡æ¯æ¨¡å— */
#player-content1{
	position: absolute;
	top:-22px;
	left:15px;
	width:90%;
	height:90px;
	padding:0 20px 0 130px;
	background: rgb(209, 226, 245);
	border-top-left-radius: 10px;
	border-top-right-radius: 10px;
/* transitionè¿‡æ¸¡åŠ¨ç”»ï¼šè®¾ç½®topå±æ€§è¿‡æ¸¡ï¼Œè¿‡æ¸¡æ—¶é—´0.3s,é€Ÿåº¦æ›²çº¿ä¸ºease(é€æ¸å˜æ…¢) */
	transition:top 0.3s ease; 
}
#player-content1.active{
	top:-85px;
}

.music-name,.artist-name{
	height: 20px;
	margin-top:5px;
	font-size:14px;
	overflow-x: auto;
}
.artist-name{
	font-size:12px;
	color: #656565
}

.time{
	font-size:12px;
	height:15px;
	margin: 5px 0;
}

.current-time,.total-time{
	float: left;
	color: transparent;
	font-size: 11px;
	background-color: #e8f5ff;
